import {BrowserRouter, Switch, Route} from 'react-router-dom';

import Home from '../pages/Home';
import Details from '../component/Details/Details';

const Router = () => {
  return (
    <BrowserRouter>
      <Switch>
        <Route path='/'>
          <Home />
        </Route>
        {
          <Route path='/:id'>
            <Details />
          </Route>
        }
      </Switch>
    </BrowserRouter>
  );
};

export default Router;
